const Services = () => {
  return (
    <>
    <div className="Services">
      <img src={Banner} alt="banner" />
      <h1>Mon offre de Services</h1>  
      <p>Voici les prestations sur lesquelles je peux intervenir</p>
      <hr />
    </div>
    </>
  )
  }
  
  export default Services;
